import { useSelector } from "react-redux";

const PrecticeRedux = () => {
    const counter = useSelector(state => state.counter)

    return <div style={{ 'textAlign': "center" }}>
        <div>
        <p>Counter:</p>
        <p>{counter}</p>
        </div>

        <div>
            Va
        </div>
    </div>
}

export default PrecticeRedux;
